Rules.InvariantScript:
Set(
    gblResetComponents,
    true
);
Set(
    gblResetComponents,
    false
)

With(
    {
        varTextNumbersOnly: Concat(
            MatchAll(
                txtTextControlTB.Text,
                Match.Digit
            ),
            FullMatch
        )
    },
    With(
        {
            varTextPhoneNumberFormat: If(
                IsBlank(TextBoxComponent.Masking.Format),
                LookUp(
                    TextBoxComponent.Masking.FormatMultiple,
                    StartsWith(
                        varTextNumbersOnly,
                        Prefix
                    ),
                    Format
                ),
                TextBoxComponent.Masking.Format
            )
        },
        With(
            {
                varTablePhoneNumberFormat: ForAll(
                    Sequence(Len(varTextPhoneNumberFormat)),
                    With(
                        {
                            varNumberCurrentLength: Left(
                                varTextPhoneNumberFormat,
                                Value
                            )
                        },
                        {
                            NumberFormat: varNumberCurrentLength,
                            CountNumbers: CountRows(
                                MatchAll(
                                    varNumberCurrentLength,
                                    "#"
                                )
                            )
                        }
                    )
                )
            },
            Set(
                gblText,
                Text(
                    Value(varTextNumbersOnly),
                    Substitute(
                        LookUp(
                            ForAll(
                                Sequence(
                                    Max(
                                        varTablePhoneNumberFormat,
                                        CountNumbers
                                    )
                                ),
                                LookUp(
                                    varTablePhoneNumberFormat,
                                    CountNumbers = Value
                                )
                            ),
                            CountNumbers = Len(varTextNumbersOnly),
                            NumberFormat
                        ),
                        "#",
                        "0"
                    )
                )
            );
            Set(
                gblTextMaxLength,
                Len(varTextPhoneNumberFormat)
            )
        )
    )
);
Reset(txtTextControlTB);
Set(
    varWasPhoneNumberEdited,
    true
)

Switch(
    TextBoxComponent.Masking.Masking,
    "AlphaNumeric",
    If(
        !IsMatch(
            txtTextControlTB.Text,
            "^[a-zA-Z0-9 ]*$"
        ) && !IsBlank(txtTextControlTB.Text),
        Set(
            gblText,
            Left(
                txtTextControlTB.Text,
                Len(txtTextControlTB.Text) - 1
            )
        );
        Reset(txtTextControlTB);
    ),
    "PostCode",
    If(
        !IsMatch(
            txtTextControlTB.Text,
            "^[a-zA-Z0-9 ]*$"
        ) && !IsBlank(txtTextControlTB.Text),
        Set(
            gblText,
            Left(
                txtTextControlTB.Text,
                Len(txtTextControlTB.Text) - 1
            )
        );
        Reset(txtTextControlTB),
        !IsMatch(
            txtTextControlTB.Text,
            "^[A-Z0-9 ]*$"
        ) && !IsBlank(txtTextControlTB.Text),
        Set(
            gblText,
            Upper(txtTextControlTB.Text)
        );
        Reset(txtTextControlTB)
    ),
    "PhoneNumber",
    If(
        !IsMatch(
            txtTextControlTB.Text,
            "^[\d\s]+$"
        ) && !IsBlank(txtTextControlTB.Text),
        Set(
            gblText,
            Left(
                txtTextControlTB.Text,
                Len(txtTextControlTB.Text) - 1
            )
        );
        Reset(txtTextControlTB),
        If(
            Len(txtTextControlTB.Text) = 5,
            Set(
                gblText,
                txtTextControlTB.Text & " "
            );
            Reset(txtTextControlTB),
            Len(txtTextControlTB.Text) > 5,
            Set(
                gblText,
                Left(
                    txtTextControlTB.Text,
                    5
                ) & " " & Right(
                    txtTextControlTB.Text,
                    Len(txtTextControlTB.Text) - 6
                )
            );
            Reset(txtTextControlTB);
        );
    ),
    "Currency",
    Set(
        gblText,
        Text(
            Value(txtTextControlTB.Text),
            "#,###"
        )
    );
    Reset(txtTextControlTB);
    ,
    "PolicyNumber",
    If(
    //Scenario 1
        IsMatch(
            Left(
                txtTextControlTB.Text,
                2
            ),
            "^[0-9]*$"
        ),
        Set(
            gblPolicyScenario,
            "I+"
        );
        If(
            !IsMatch(
                Mid(
                    txtTextControlTB.Text,
                    3,
                    3
                ),
                "^[a-zA-Z]*$"
            ),
            Set(
                gblText,
                Left(
                    txtTextControlTB.Text,
                    Len(txtTextControlTB.Text) - 1
                )
            );
            Reset(txtTextControlTB),
            !IsMatch(
                Mid(
                    txtTextControlTB.Text,
                    6
                ),
                "^[0-9]*$"
            ),
            Set(
                gblText,
                Left(
                    txtTextControlTB.Text,
                    Len(txtTextControlTB.Text) - 1
                )
            );
            Reset(txtTextControlTB),
        //Capatlising
            If(
                !IsMatch(
                    txtTextControlTB.Text,
                    "^[A-Z]*$"
                ) && !IsBlank(txtTextControlTB.Text),
                Set(
                    gblText,
                    Upper(txtTextControlTB.Text)
                );
                Reset(txtTextControlTB)
            );
    //End Cap
        ),
    //Scenario 2
        IsMatch(
            Left(
                txtTextControlTB.Text,
                3
            ),
            "^[a-zA-Z]*$"
        ),
        Set(
            gblPolicyScenario,
            "ANSVAR I90"
        );
    //Capatlising
If(
            !IsMatch(
                txtTextControlTB.Text,
                "^[A-Z]*$"
            ) && !IsBlank(txtTextControlTB.Text),
            Set(
                gblText,
                Upper(txtTextControlTB.Text)
            );
            Reset(txtTextControlTB)
        );
    //End Cap
If(
            !IsMatch(
                Mid(
                    txtTextControlTB.Text,
                    4
                ),
                "^[0-9]*$"
            ),
            Set(
                gblText,
                Left(
                    txtTextControlTB.Text,
                    Len(txtTextControlTB.Text) - 1
                )
            );
            Reset(txtTextControlTB)
        ),
    //Scenario 3
        IsMatch(
            Left(
                txtTextControlTB.Text,
                2
            ),
            "^[a-zA-Z-]*$"
        ),
        Set(
            gblPolicyScenario,
            "Halo"
        );
        If(
            !IsMatch(
                Mid(
                    txtTextControlTB.Text,
                    3
                ),
                "^[0-9]*$"
            ),
            Set(
                gblText,
                Left(
                    txtTextControlTB.Text,
                    Len(txtTextControlTB.Text) - 1
                )
            );
            Reset(txtTextControlTB)
        ),
        Set(
            gblText,
            Left(
                txtTextControlTB.Text,
                Len(txtTextControlTB.Text) - 1
            )
        );
        Reset(txtTextControlTB)
    )
)

With(
    {
        Height: txtTextControlTB.Height + If(
            lblTitleTextTB.Visible,
            lblTitleTextTB.Height,
            Self.StylingProperty.TextInput.Margin
        ) + Self.StylingProperty.TextInput.Margin
    },
    If(
        Self.ErrorVisible,
        Height + TextBoxComponent.ErrorExtention,
        Height
    )
)

Set(
    gblShowErrorPopup,
    false
);
If(
    Self.Clear,
    Set(
        gblText,
        Blank()
    )
);
Reset(txtTextControlTB);
Reset(tmrMaskingTB);
